import React, { useState } from "react";
import { Container, Row, Col, Form, Button } from "react-bootstrap";
import { FaUser, FaEnvelope, FaLock, FaPhone } from "react-icons/fa";

const RegisterPage = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [role, setRole] = useState("");


  const handleRegister = (e) => {
    e.preventDefault();
    // Registration logic here
    alert(`Registering user: ${name}`);
  };

  return (
    <div className="bg-dark min-vh-100 d-flex align-items-center text-light">
      <Container>
        <Row className="justify-content-center">
          <Col xs={12} md={6} lg={4}>
            <div className="bg-secondary p-4 rounded shadow">
              <h2 className="text-center mb-4">Register</h2>
              <Form onSubmit={handleRegister}>
                <Form.Group className="mb-3" controlId="formName">
                  <Form.Label>
                    <FaUser className="me-2" />
                    Name
                  </Form.Label>
                  <Form.Control
                    type="text"
                    placeholder="Enter your name"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    required
                    className="bg-dark text-light border-0"
                  />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formEmail">
                  <Form.Label>
                    <FaEnvelope className="me-2" />
                    Email
                  </Form.Label>
                  <Form.Control
                    type="email"
                    placeholder="Enter email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    required
                    className="bg-dark text-light border-0"
                  />
                </Form.Group>

                ////////////////////////////////////////////////////
                   <Form.Group className="mb-3" controlId="formRole">
                     <Form.Label>
                       <FaUser className="me-2" />
                         User Role
                    </Form.Label>
                    <Form.Select
                         value={role}
                         onChange={(e) => setRole(e.target.value)}
                         required
                       className="bg-dark text-light border-0"
                    >
                      <option value="" disabled>
                          Select role
                            </option>
                                <option value="user">User</option>
                                <option value="manager">Manager</option>
                             </Form.Select>
                         </Form.Group>



                /////////////////////////////////////////////////
   
                
                <Form.Group className="mb-4" controlId="formPassword">
                  <Form.Label>
                    <FaLock className="me-2" />
                    Password
                  </Form.Label>
                  <Form.Control
                    type="password"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required
                    className="bg-dark text-light border-0"
                  />
                </Form.Group> 

                <Form.Group className="mb-4" controlId="formConfirmPassword">
                    <Form.Label>
                      <FaLock className="me-2" />
                            Confirm Password
                    </Form.Label>
                         <Form.Control
                           type="password"
                           placeholder="Confirm Password"
                           value={confirmPassword}
                           onChange={(e) => setConfirmPassword(e.target.value)}
                        required
                        className="bg-dark text-light border-0"
                            />
                </Form.Group>


                <Button type="submit" variant="primary" className="w-100 fw-semibold">
                  Register
                </Button>
              </Form>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default RegisterPage;
